  function Helper(container) {
    this.container = container;

    this.entry();
    this.events();



    this.display();
  }
  Helper.prototype.entry = function() {
    var container = this.container;
    var entryNode = this.entryNode = $('<div class="entry"></div>')
    .appendTo(container);
    entryNode.keyAnim('fadeInLeft',{
      time:0.6
    });


    var quality = 1.5;
    var w = entryNode.width();
    var h = entryNode.height();
    var canvas = $('<canvas width="'+w*quality+'" height="'+h*quality+'" style="position:absolute;top:0;left:0;width:100%;height:100%"></canvas>')
    entryNode.append(canvas);
    var brushes = new  Brushes(this.ctx);
    this.renderer = new Renderer(brushes,{frameW:w,frameH:h});

    canvas = canvas[0];
    var ctx = this.ctx = canvas.getContext('2d');
    // ctx.fillStyle = '#222';
    // ctx.fillRect(0,0,w*quality,h*quality);
    ctx.scale(quality, quality);
  };

  Helper.prototype.display = function() {
    this.renderer.drawDatas(this.ctx, displayData);
  };

  Helper.prototype.events = function(){
    var body = $('body');
    var container = this.container;
    container.on('touchstart', function(){
      $('.entry').keyAnim('fadeOut',{
        time:0.5,
        cb:function(){
          body.trigger('start');
        }
      });
      // container.off('touchstart');
    });
  };

  return Helper;
